import React from "react";
import { createRoot } from "react-dom/client";
import { BrowserRouter } from "react-router-dom";

import App from "./App";

const root = ReactDOM.createRoot(document.getElementById('root'));

const routes = createBrowserRouter([
  {
    path: "/",
    element: <Home />
  },
  {
    path: "/",
    element: <CreateForm />
  },
  {
    path: "/animal/add",
    element: <CreateForm />
  },
  {
    path: "/categories",
    element: <CreateCategories />
  },
  {
    path: "/categories/create",
    element: <CreateCategories />
  },
  {
    path: "/animals/category/:catId?",
    element: <Animals />
  },
  {
    path: "/animals/",
    element: <Animals />,
    loader: getAllAnimals,
    children: [
      {
        path: "/animals/:animalId",
        element: <AnimalItem />,
        loader: async ({ params }) => getOneAnimal(params.animalId)
      }
    ]
  },
  {
    path: "/animals/:animalId",
    element: <AnimalItem />
  },
  {
    path: "/animals/:animalId/edit",
    element: <EditForm />
  },
  {
    path: "/animal-item",
    element: <AnimalItem />
  },
  {
    path: "/login",
    element: <Login />
  },
  {
    path: "/register",
    element: <Register />
  },
  {
    path: "/registration",
    element: <Registration />
  },
  {
    path: "/profile",
    element: <Profile />
  },
  {
    path: "/user",
    element: <BoardUser />
  },
  {
    path: "/mod",
    element: <BoardModerator />
  },
  {
    path: "/admin",
    element: <BoardAdmin />
  },
  {
    path: "/blog",
    element: <BlogPage />
  },
  {
    path: "/posts/:postId",
    element: <OnePost />
  },
  {
    path: "/post/create",
    element: <CreatePost />
  },
  {
    path: "/posts/:postId/edit",
    element: <EditPost />
  },
  {
    path: "*",
    element: <Page404 />
  }
]);

